    max_elements = []
    current_max = float('')
    for operation in operations:
        entries = operation.split()
        if entries[0] == '1':
            value = int(entries[1])
            stack.append(value)
            if value > current_max:
                current_max = value
        elif entries[0] == '2':
            if stack:
